import React from "react";

export default function Nav() {
  return (
    <div>
        <nav>
        <Link to="/"> Home</Link>
        <Link to="/Location"> Location </Link>
        <Link to="/Reviews"> Review </Link>
      </nav>
    </div>
  );
}
